import React from 'react';

const Counseling = () => {
  return (
    <div style={{ padding: '1rem' }}>
      <h1>Layanan Konseling Terintegrasi</h1>
      <ul>
        <li>Terhubung dengan konselor sekolah.</li>
        <li>Bisa chat langsung atau buat jadwal konseling offline/online.</li>
        <li>Sistem notifikasi pengingat.</li>
      </ul>
      <div style={{ marginTop: '1rem' }}>
        <h2>Chat dengan Konselor (Demo)</h2>
        <div
          style={{
            border: '1px solid #4B3A26',
            padding: '1rem',
            height: '200px',
            overflowY: 'auto',
            marginBottom: '1rem',
          }}
        >
          <p><i>Chat belum tersedia di demo ini.</i></p>
        </div>
        <button
          style={{
            backgroundColor: '#4B3A26',
            color: 'white',
            border: 'none',
            padding: '0.5rem 1rem',
            cursor: 'not-allowed',
          }}
          disabled
        >
          Kirim Pesan
        </button>
      </div>
      <div style={{ marginTop: '1rem' }}>
        <h2>Jadwal Konseling</h2>
        <p><i>Fitur penjadwalan belum tersedia di demo ini.</i></p>
      </div>
    </div>
  );
};

export default Counseling;
